import React, { useState, useEffect, useRef } from "react";
import io from "socket.io-client";
import {
  Box, Button, TextField, Typography, Avatar, Paper, AppBar, Toolbar,
  Container, List, ListItem, ListItemAvatar, ListItemText, Divider, CircularProgress, Stack
} from "@mui/material";
import PhotoCamera from "@mui/icons-material/PhotoCamera";

const socket = io("http://localhost:5000");

function App() {
  const [username, setUsername] = useState("");
  const [receiver, setReceiver] = useState("");
  const [input, setInput] = useState("");
  const [messages, setMessages] = useState([]);
  const [objects, setObjects] = useState([]);
  const [imageData, setImageData] = useState("");
  const [cvLoading, setCvLoading] = useState(false);
  const [webcamStarted, setWebcamStarted] = useState(false);
  const videoRef = useRef(null);

  useEffect(() => {
    if (username) socket.emit("register", username);
  }, [username]);

  useEffect(() => {
    socket.on("message", (msg) => {
      setMessages((prev) => [...prev, msg]);
    });
    return () => socket.off("message");
  }, []);

  const handleStartWebcam = () => {
    navigator.mediaDevices.getUserMedia({ video: true }).then((stream) => {
      videoRef.current.srcObject = stream;
      setWebcamStarted(true);
    });
  };

  const captureAndDetect = async () => {
    setCvLoading(true);
    setObjects([]);
    setImageData("");

    const canvas = document.createElement("canvas");
    canvas.width = videoRef.current.videoWidth;
    canvas.height = videoRef.current.videoHeight;
    canvas.getContext("2d").drawImage(videoRef.current, 0, 0);
    canvas.toBlob(async (blob) => {
      try {
        const formData = new FormData();
        formData.append("file", blob, "snapshot.jpg");
        const resp = await fetch("http://localhost:8000/detect", {
          method: "POST",
          body: formData,
        });
        if (!resp.ok) throw new Error("CV API error");
        const data = await resp.json();
        setObjects(data.objects || []);
        setImageData(canvas.toDataURL("image/jpeg"));
      } catch (e) {
        alert("Failed to fetch from backend: " + e.message);
      } finally {
        setCvLoading(false);
      }
    }, "image/jpeg");
  };

  const handleSend = () => {
    if (!username || !receiver || !input || objects.length === 0) {
      alert("Enter all fields and detect objects first!");
      return;
    }
    const msg = {
      sender: username,
      receiver,
      text: input,
      objects,
      image: imageData,
      time: new Date().toLocaleTimeString(),
    };
    socket.emit("message", msg);
    setMessages((prev) => [...prev, msg]);
    setInput("");
    setObjects([]);
    setImageData("");
  };

  return (
    <Box sx={{ bgcolor: "#f7fafc", minHeight: "100vh" }}>
      <AppBar position="static" sx={{ background: "#283593" }}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            ðŸŽ¯ Object-Scoped Messenger
          </Typography>
        </Toolbar>
      </AppBar>
      <Container maxWidth="md" sx={{ mt: 4 }}>
        <Paper elevation={3} sx={{ p: 4, borderRadius: 3 }}>
          <Stack spacing={2} alignItems="center">
            <Stack direction={{ xs: "column", sm: "row" }} spacing={2} width="100%">
              <TextField
                label="Your Username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                variant="outlined"
                sx={{ maxWidth: 200 }}
                disabled={messages.length > 0}
              />
              <TextField
                label="Receiver Username"
                value={receiver}
                onChange={(e) => setReceiver(e.target.value)}
                variant="outlined"
                sx={{ maxWidth: 200 }}
              />
            </Stack>

            <Stack direction={{ xs: "column", sm: "row" }} spacing={2} alignItems="flex-start" width="100%">
              <Box>
                <video
                  ref={videoRef}
                  width={260}
                  height={200}
                  autoPlay
                  style={{
                    display: webcamStarted ? "block" : "none",
                    borderRadius: 8,
                    border: "1px solid #ccc",
                  }}
                />
                {!webcamStarted && (
                  <Button
                    startIcon={<PhotoCamera />}
                    variant="contained"
                    onClick={handleStartWebcam}
                    sx={{ width: 260, mb: 1 }}
                  >
                    Start Webcam
                  </Button>
                )}
                {webcamStarted && (
                  <Button
                    variant="outlined"
                    onClick={captureAndDetect}
                    fullWidth
                    color="secondary"
                    sx={{ mb: 1 }}
                    disabled={cvLoading}
                  >
                    {cvLoading ? <CircularProgress size={18} /> : "Detect Objects"}
                  </Button>
                )}

                {objects.length > 0 && (
                  <Box sx={{ mt: 1 }}>
                    <Typography variant="subtitle1" color="secondary">
                      Detected Objects:
                    </Typography>
                    {objects.map((obj, i) => (
                      <Typography key={i} variant="body2">
                        {obj.label} ({(obj.confidence * 100).toFixed(1)}%)
                      </Typography>
                    ))}
                    {imageData && (
                      <Avatar src={imageData} sx={{ width: 60, height: 60, mt: 1 }} />
                    )}
                  </Box>
                )}
              </Box>

              <Box flex={1}>
                <Paper elevation={0} sx={{ maxHeight: 240, overflowY: "auto", bgcolor: "#f4f6fa", mb: 2 }}>
                  <List disablePadding>
                    {messages.map((msg, i) => (
                      <React.Fragment key={i}>
                        <ListItem>
                          <ListItemAvatar>
                            <Avatar sx={{ bgcolor: "#283593" }}>
                              {msg.sender?.slice(0, 2).toUpperCase()}
                            </Avatar>
                          </ListItemAvatar>
                          <ListItemText
                            primary={
                              <Box sx={{
                                bgcolor: msg.sender === username ? "#c5cae9" : "#e3f2fd",
                                display: "inline-block",
                                borderRadius: 3,
                                px: 2, py: 1,
                                fontSize: 15
                              }}>
                                {msg.text}
                              </Box>
                            }
                            secondary={
                              <>
                                {msg.sender} âž” {msg.receiver}
                                <br />
                                {msg.objects?.map((o, j) => (
                                  <span key={j}>
                                    ðŸŽ¯ {o.label} ({(o.confidence * 100).toFixed(1)}%){" "}
                                  </span>
                                ))}
                                <br />
                                <span style={{ fontSize: 11, color: "#888" }}>{msg.time}</span>
                              </>
                            }
                          />
                        </ListItem>
                        {i < messages.length - 1 && <Divider variant="inset" />}
                      </React.Fragment>
                    ))}
                  </List>
                </Paper>

                <Stack direction="row" spacing={2}>
                  <TextField
                    label="Type your message..."
                    value={input}
                    onChange={(e) => setInput(e.target.value)}
                    variant="outlined"
                    fullWidth
                    onKeyDown={(e) => { if (e.key === "Enter") handleSend(); }}
                  />
                  <Button
                    onClick={handleSend}
                    variant="contained"
                    size="large"
                    disabled={!username || !receiver || !input || objects.length === 0}
                  >
                    Send
                  </Button>
                </Stack>
              </Box>
            </Stack>
          </Stack>
        </Paper>
      </Container>
    </Box>
  );
}

export default App;
